                margin-left: 1rem;
                border-left: 1px solid rgb(239, 239, 239);
            }
            .title{
                text-transform: uppercase;
                margin-bottom: 12px;
                font-weight: 600;
                font-size: 0.8em;
            }
         `
        }
        </style>
        </div>
    </Layout>
